import styled from "styled-components";

export const Container = styled.div`
  cursor: pointer;

  svg {
    width: 30px;
    height: 30px;
  }
  svg path {
    fill: ${props => (props.currentTheme === "light" ? "#0b0316" : "#d6d9e3")};
  }
`;
